import React from 'react'

const StackBtn = (props)=> {

    if (props.name=="Node") {
        props.name = "nodejs"
    }

    return (
      <div className={`stack-btn stack-${props.name.toLowerCase()} mr-2 mb-1`}>
        <i className={`devicon-${props.name.toLowerCase()}-plain`}></i>
      </div>
    );
}

export default StackBtn
